<!DOCTYPE html>
<html>
<head>
	<title>WFT 1.1</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Roboto:wght@300&display=swap');
        body {
            background-color: #1a1a1a;
            font-family: 'Roboto', sans-serif;
            font-size: 1.3em;
        }
        #content-container {
            display: flex;
            flex-direction: column;
            height: 100vh;
        }
        #message, #image-map-pro {
            display: none;
        }
        #message {
            color: white;
            position: fixed;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 1.6em;
            text-align: center;
        }
        #logo {
            width: 260px;
            margin-bottom: 26px;
        }
        #rotate-logo {
            width: 97.5px;
            margin-top: 26px;
        }
        #back-button {
            align-self: flex-end;
            padding: 10px 20px;
            background-color: red;
            color: white;
            border-radius: 20px;
            font-size: 0.8em;
            text-decoration: none;
            transition: background-color 0.3s;
            margin: 20px;
        }
        #back-button:hover {
            background-color: darkred;
        }
        /* Adjust the position of the back button for portrait orientation */
        @media (orientation: portrait) {
            #content-container {
                justify-content: flex-end;
            }
        }
        /* Adjust the position of the back button for landscape orientation */
        @media (orientation: landscape) {
            #content-container {
                justify-content: space-between;
            }
        }
    </style>
</head>
<body>
    <div id="content-container">
        <div id="image-map-pro"></div>
        <div id="message">
            <div><img id="logo" src="logo.png" alt="Logo"></div>
            <div>Please rotate your device.</div>
            <div><img id="rotate-logo" src="rotate.png" alt="Rotate"></div>
        </div>
        <a id="back-button" href="http://www.worldfoodtrucks.com">Back</a>
    </div>

    <script>
        function checkOrientation() {
            var isPortrait = window.matchMedia("(orientation: portrait)").matches;
            var message = document.getElementById('message');
            var data = document.getElementById('image-map-pro');

            if (isPortrait) {
                data.style.display = 'none';
                message.style.display = 'block';
            } else {
                data.style.display = 'block';
                message.style.display = 'none';
            }
        }

        window.addEventListener('orientationchange', checkOrientation);
        window.addEventListener('resize', checkOrientation);

        // Check initial orientation
        checkOrientation();
    </script>
</body>
